import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './Navbar';

import BusinessInsights from './BusinessInsights';
import DeliveryAvailability from './DeliveryAvailability'; // Import the DeliveryAvailability component

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Switch>
          <Route path="/business-insights" component={BusinessInsights} />
          <Route path="/delivery-availability" component={DeliveryAvailability} /> {/* Route for DeliveryAvailability */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
